def get_target(url2):
    url = url2.rstrip()
    target = {}
    parsed_url = urlparse(url)
    target['uri'] = parsed_url.path or '/'
    target['host'] = parsed_url.netloc
    target['scheme'] = parsed_url.scheme
    target['port'] = parsed_url.port or ("443" if target['scheme'] == "https" else "80")
    target['normal'] = url2
    return target

def get_command(files,meth='BROWSER'):
    commands = {}
    with open(files,'r') as f:
      for a in f.readlines():
         raw = a.replace('\n','').replace('\r','').split(' ')
         for m in raw[1].split('#'):
            if m == meth:
               if raw[0].split('+')[0] == 'PATH':
                  raw_c = raw[0].split('+')
               else:
                raw_c = raw[0].split('=')
               commands[raw_c[0]] = str(raw_c[1])
    return commands

def gen_ips():
    return '.'.join(str(random.randint(0, 255)) for _ in range(4))

import random
import string

def gen_id(id=''):
    letters_and_digits = string.ascii_lowercase + string.digits
    if id:generated_id = ''.join(random.choice(letters_and_digits) for _ in range(id))
    else:generated_id = '-'.join([''.join(random.choice(letters_and_digits) for _ in range(length)) for length in [8, 4, 4, 4, 12]])
    return generated_id

